Minting NFTs from a single address is a simple enough example to start. However, a complete application would typically offer the possibility for the users to transfer or sell their NFTs. As final users do not have tez in their wallet, all the transactions are posted by the Gas Station. Despite this centralization, it is still possible to maintain security and non-custodiality using permits. In this section, we call staking the operation of sending an NFT to a contract. As the user owns the NFT, it is appropriate to sign a permit (authorization) to perform this transfer. To facilitate the development of this new feature, we will also use the TypeScript SDK (for reference, you have all the information here ) To start, let's initialize the GasStation and PermitContract classes from the SDK: ‚ÑπÔ∏è GasStation class will target the Gas Station deployed on Ghostnet by default. const gasStationApi = new GasStation();
const permitContract = new PermitContract(PUBLIC_PERMIT_CONTRACT, Tezos); Now we can generate our permit using the generatePermit method: const permitData = await permitContract.generatePermit({ from_: userAddress, txs: [{ to_: PUBLIC_STAKING_CONTRACT, token_id, amount: 1 }] }); Some explanations: The variable PUBLIC_STAKING_CONTRACT contains the address of the staking contract (available at this address KT1VVotciVbvz1SopVfoXsxXcpyBBSryQgEn on Ghostnet). The token_id corresponds to the ID of the token you want to stake. permitData then contains the hash of the permit bytes and the hash of transfer operation transfer_hash: { bytes: string; transfer_hash: string;
} Next, we need to have the owner of the token sign this permit and retrieve the signature. This is easily done using Taquito: const signature = (await (await wallet.client).requestSignPayload({ signingType: SigningType.MICHELINE, payload: permit_data.bytes })).signature; Once we have the signed permit, we can register it with the contract that implements the permit entrypoint. Again, we can use the SDK for this: const permitOperation = await permitContract.permitCall({ publicKey: activeAccount.publicKey, signature: signature, transferHash: permit_data.transfer_hash }); publicKey is the public key of the token's owner signature is the signature of the permit obtained in the previous step transferHash is the hash of the transfer operation returned during the permit creation At this point, we have all the necessary information regarding the permit. Now, we can forge the staking operation itself and send everything to the Gas Station. To forge the staking operation, we follow the usual process: we retrieve the contract instance using Taquito and craft the operation to get the parameters. const stakingContract = await Tezos.wallet.at(PUBLIC_STAKING_CONTRACT);
const stakingOperation = await stakingContract.methods.stake( 1, userAddress ).toTransferParams(); ‚ÑπÔ∏è PUBLIC_STAKING_CONTRACT is also an environment variable containing the staking contract's address. All that remains is to send the operation to the Gas Station to have the gas fees covered: const response = await gasStationApi.postOperations(userAddress, [ { destination: permitOperation.to, parameters: permitOperation.parameter }, { destination: stakingOperation.to, parameters: stakingOperation.parameter } ]); Here, we use postOperations to submit a batch of operations. This batch contains the operation to register the permit and the staking operation. When calling the staking contract's stake entrypoint, the permit will be revealed and consumed. Similar to the minting operation, the Gas Station will respond in a few tens of seconds.

